import { Box, Button, LinearProgress, Typography, Alert } from "@mui/material";
import { styled } from "@mui/system";
import React, { useContext, useEffect, useState } from "react";
import MyLogin from "./MyLogin";
import { DataBorneContext } from "./ContextBorne";
import BodyApp from "./BodyApp";

function AppBorneMulhouse1() {
  const {
    MyBox,
    dataBorne,
    setDataBorne,
    progressBar,
    setprogressBar,
    loginEtat,
    setLoginEtat,
  } = useContext(DataBorneContext);

  function borneAvailable() {
    let e;
    if (dataBorne.propriety.available === true) {
      e = (
        <Typography variant="h3" sx={{ color: "green" }}>
          Disponible
        </Typography>
      );
    }
    if (dataBorne.propriety.available === false) {
      e = (
        <Typography variant="h3" sx={{ color: "red" }}>
          Indisponible
        </Typography>
      );
    }
    return e;
  }
  function validateAlert() {
    if (dataBorne.propriety.available === false) {
      return (
        <Alert severity="success">
          This is a success alert â€” check it out!
        </Alert>
      );
    }
  }
  const handleClickValidate = () => {
    setDataBorne(dataBorne);
    console.log("2");
    console.log(dataBorne);
    const requestOptions = {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(dataBorne),
    };
    fetch(
      `http://151.80.137.77:1880/mulhouse/borne_1/login/data_borne.json`,
      requestOptions
    ).then((response) =>
      response.json().then((dataBorne) => setDataBorne(dataBorne))
    );
    console.log("3");
    console.log(dataBorne);
    console.log(dataBorne.propriety.available);
    validateAlert();
    setLoginEtat("false");
    setprogressBar(20);
    if (dataBorne.propriety.available === false) {
      console.log("je vais au HOME");
    }
  };
  function showEtat() {
    let el = (
      <MyBox>
        <Typography>Ini </Typography>
      </MyBox>
    );
    console.log("0");
    console.log(loginEtat);
    if (loginEtat) {
      console.log("1");
      el = (
        <MyBox>
          <MyLogin />
          <Button
            variant="contained"
            onClick={() => {
              data_borne.login.email = values.email;
              data_borne.login.password = values.password;
              console.log("1");
              console.log(data_borne);
              handleClickValidate();
            }}
          >
            Valider
          </Button>
        </MyBox>
      );
    } else {
      console.log("2");
      el = (
        <MyBox>
          <Typography>Coucou Ã§a marche ? </Typography>
          <Button
            variant="contained"
            onClick={() => {
              setLoginEtat(true);
            }}
          >
            loginEtat
          </Button>
        </MyBox>
      );
    }
    return el;
  }

  return (
    <>
      <MyBox>
        <Typography variant="h2">Borne 1 - Mulhouse</Typography>
      </MyBox>

      <MyBox>{borneAvailable()}</MyBox>
      <MyBox>
        <LinearProgress
          variant="determinate"
          sx={{
            m: 2,
            width: "50%",
            height: 10,
            borderRadius: 5,
          }}
          value={progressBar}
        />
      </MyBox>

      {showEtat()}
    </>
  );
}

export default AppBorneMulhouse1;
